import React , {Component} from 'react';


class AddContact extends Component{

    render(){
        return(
            <div className="row">
                    <div className="col-md-8 mx-auto">
                    <div className='card p-3 m-5 shadow-sm p-4 mb-5 bg-body rounded'>
                            <p className='text-center text-primary fs-2 fw-lighter'>Add Contact</p> 
                            <form>
                                <div class="mb-3">
                                    <label for="exampleInputEmail1" className="form-label">name & prenom</label>
                                    <input type="text" className="form-control" />
                                </div>
                                <div class="mb-3">
                                    <label for="exampleInputPassword1" className="form-label">telephone</label>
                                    <input type="text" className="form-control" id="exampleInputPassword1" />
                                </div>
                                <button type="submit" className="btn btn-primary rounded-pill">Submit</button>
                            </form>
                    </div>
                    </div>
                </div>
          
        )
    }
}

export default AddContact;
